import orderArrow from './img/orderChangeArrow.png'

function OrderChange() {
    return (
        <div className='orderChange'>
            <p>최신순</p>
            <img className='orderArrow' src={orderArrow} alt='화살표'/>
            <div>
            <p>최신순</p>
            <p>좋아요순</p>
            </div>
        </div>
    );
}

export default OrderChange;
